import React from "react";
import Container from "../components/Container";
import { Heading1 } from "../components/Heading";
import Button from "../components/Button";
import backIcon from "../assets/backIcon.svg";
import { theme } from "../theme";
import { Flex, Text, Link, Image, Box } from "rebass";

const ResourcePageReplacement = () => {
  return (
    <Container>
      <Link href="/" margin="25px" style={{ underline: none }}>
        <Button variant="primary">
          <Image src={backIcon} height={25} width={25} marginRight="1px" />
        </Button>
      </Link>
      <Flex width="100%" flexDirection="column">
        <Heading1 marginLeft="25px">Resources</Heading1>
      </Flex>

      <Flex width="100%" justifyContent="center" margin="5px">
        <Link href={"/blog"} width="90%">
          <Box
            sx={{
              p: 2,
              bg: theme.colors.persianblue,
              width: "100%",
              boxShadow: "card",
              borderRadius: 24,
            }}
          >
            <Text
              fontFamily={theme.fonts.bold}
              fontWeight={theme.fontWeights.bold}
              fontSize={theme.fontSizes[3]}
              color={theme.colors.gainsboro}
              marginLeft={2}
            >
              Blog
            </Text>
            <Text
              fontSize={theme.fontSizes[1]}
              color={theme.colors.gainsboro}
              margin={2}
              fontFamily={theme.fonts.body}
            >
              Here you'll find any and all articles I write!
            </Text>
          </Box>
        </Link>
      </Flex>
    </Container>
  );
};

export default ResourcePageReplacement;
